import React from 'react';

const UnresolvedTodos = ({ todos }) => {
  return (
    <div>
      <h2>Pendientes Sin Resolver</h2>
      <table className="table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Title</th>
          </tr>
        </thead>
        <tbody>
          {todos.map(todo => (
            <tr key={todo.id}>
              <td>{todo.id}</td>
              <td>{todo.title}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default UnresolvedTodos;
